import React from "react";

const ResultsTable = ({ results }) => {
  if (results.length === 0) return null;

  return (
    <table
      style={{
       width: "100%",
        maxWidth: "1100px", // Optional: limit to match top filter max width
        margin: "30px auto",
        margin: "30px auto",
        borderCollapse: "collapse",
        fontFamily: "Ramaraja, serif",
        backgroundColor: "white",
        boxShadow: "0 2px 8px rgba(0,0,0,0.05)",
      }}
    >
      <thead>
        <tr style={{ backgroundColor: "#FF671D", color: "white", fontSize: "16px" }}>
          <th style={{ padding: "12px" }}>Country</th>
          <th style={{ padding: "12px" }}>Partner University</th>
          <th style={{ padding: "12px" }}>Partner Course Code</th>
          <th style={{ padding: "12px" }}>Partner Course Name</th>
          <th style={{ padding: "12px" }}>Pacific Course Code</th>
          <th style={{ padding: "12px" }}>Pacific Course Name</th>
        </tr>
      </thead>
      <tbody>
        {results.map((course, idx) => (
          <tr
            key={idx}
            style={{
              borderBottom: "1px solid #eee",
              backgroundColor: idx % 2 === 0 ? "#fdfdfd" : "#fff",
              transition: "background 0.3s",
              cursor: "default",
            }}
            onMouseEnter={(e) => (e.currentTarget.style.backgroundColor = "#fff3eb")}
            onMouseLeave={(e) => (e.currentTarget.style.backgroundColor = idx % 2 === 0 ? "#fdfdfd" : "#fff")}
          >
            <td style={{ padding: "12px" }}>{course.country}</td>
            <td style={{ padding: "12px" }}>{course.partner_university}</td>
            <td style={{ padding: "12px" }}>{course.partner_course_code}</td>
            <td style={{ padding: "12px" }}>{course.partner_course_name}</td>
            <td style={{ padding: "12px", fontWeight: "bold" }}>{course.pacific_course_code}</td>
            <td style={{ padding: "12px" }}>{course.pacific_course_name}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ResultsTable;
